webpackJsonp([52,428],{1358:function(e,s,t){e.exports={frontmatter:t(365),content:t(2531)}},2531:function(e,s,t){e.exports='<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>I denne oppagaven skal vi lære hvordan vi kan tegne med Elm.</p> <p>Her er noen vanlige elementer i webprogrammering:</p> <ul> <li><strong>HTML</strong>: Struktur. <ul> <li>&quot;Dette er en overskrift&quot;</li> <li>&quot;Dette er et avsnitt&quot;</li> <li>&quot;Dette er en liste&quot;</li> </ul> </li> <li><strong>CSS</strong>: Utseende. <ul> <li>&quot;Slik skal en overskrift se ut&quot;</li> <li>&quot;Slik skal et avsnitt se ut&quot;</li> <li>&quot;Slik skal en liste se ut&quot;</li> </ul> </li> <li><strong>Elm</strong> eller <strong>Javascript</strong>: Logikk <ul> <li>&quot;Dette skjer når jeg trykker på denne knappen&quot;</li> <li>&quot;Når jeg skriver i dette feltet, ser jeg at det andre forandrer seg&quot;</li> </ul> </li> </ul> <p>Vi skal nå bruke SVG for å tegne:</p> <ul> <li><strong>SVG</strong>: Tegning <ul> <li>&quot;Dette er en sirkel&quot;</li> <li>&quot;Sirkelen har sentrum i punktet (3,4)&quot;</li> <li>&quot;Sirkelen har bredde (diameter) 100&quot;</li> </ul> </li> </ul> <p>Jeg kommer til å vise eksempler med <strong>Try Elm</strong>. Hvis du vil kjøre nettsiden lokalt, er det helt greit.</p> </section> <section class=activity id=steg-1-sirkel-og-rektangel> <h1 class=activity id=steg-1-sirkel-og-rektangel>Steg 1: sirkel og rektangel</h1> <p>Vi prøver først litt med <a href=http://elm-lang.org/try>Try Elm</a>.</p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_0><label for=cbx_0> Lim inn dette i kodefeltet:</label></li> </ul> <pre><code class=elm><span class=hljs-keyword>import</span> Svg <span class=hljs-keyword>exposing</span> (svg, circle, rect)\n<span class=hljs-keyword>import</span> Svg.Attributes <span class=hljs-keyword>exposing</span> (width, height, viewBox, cx, cy, r, fill, x, y, width, height)\n\n\n<span class=hljs-title>main</span> =\n    svg\n      [ width <span class=hljs-string>"500"</span>, height <span class=hljs-string>"500"</span>, viewBox <span class=hljs-string>"0 0 200 200"</span> ]\n      [ circle [ cx <span class=hljs-string>"30"</span>, cy <span class=hljs-string>"50"</span>, r <span class=hljs-string>"50"</span>, fill <span class=hljs-string>"blue"</span> ] [  ]\n      , rect [ x <span class=hljs-string>"100"</span>, y <span class=hljs-string>"100"</span>, width <span class=hljs-string>"80"</span>, height <span class=hljs-string>"40"</span>, fill <span class=hljs-string>"red"</span> ] - [ ]\n      ]\n</code></pre> <p>Da skal du se noe slikt:</p> <figure><img src='+t(3281)+' alt=""></figure> <p>La oss plukke koden fra hverandre.</p> <section class=check id=jeg-kjorer-lokalt-og-far-feil> <h2 class=check id=jeg-kjorer-lokalt-og-far-feil>Jeg kjører lokalt, og får feil!</h2> <p>Hvis du prøver å kjøre lokalt, får du denne beskjeden fra Elm:</p> <pre><code class=text>Starting downloads...\n\n  ● elm-lang/html <span class=hljs-number>2.0</span>.<span class=hljs-number>0</span>\n  ● elm-lang/<span class=hljs-keyword>virtual</span>-dom <span class=hljs-number>2.0</span>.<span class=hljs-number>4</span>\n  ● elm-lang/core <span class=hljs-number>5.1</span>.<span class=hljs-number>1</span>\n\nPackages configured successfully!\nI cannot find <span class=hljs-keyword>module</span> <span class=hljs-string>\'Svg\'</span>.\n\n<span class=hljs-keyword>Module</span> <span class=hljs-string>\'Main\'</span> <span class=hljs-keyword>is</span> trying <span class=hljs-keyword>to</span> import it.\n\nPotential problems could be:\n  * Misspelled the <span class=hljs-keyword>module</span> name\n  * Need <span class=hljs-keyword>to</span> <span class=hljs-keyword>add</span> a source directory <span class=hljs-keyword>or</span> <span class=hljs-keyword>new</span> dependency <span class=hljs-keyword>to</span> elm-package.json\n</code></pre> <p>Da må vi installere pakken <code>svg</code>.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> Åpne et kommandovindu i <strong>samme mappe som du har lagret Elm-programmet ditt</strong></label></p> <p>Hvis jeg har en mappe på skrivebordet mitt som heter Elm, skal jeg se følgende: <code>C:\\Users\\teodor\\Desktop\\Elm&gt;</code></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Kjør <code>elm package install elm-lang/svg</code></label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Start <code>elm reactor</code> på nytt.</label></p> </li> </ul> <p>Fungerer det nå?</p> </section> <section class=check id=importere-moduler> <h2 class=check id=importere-moduler>Importere moduler</h2> <p>Tidligere har vi brukt pakken <strong>Html</strong> og importert funksjoner som <code>p</code> for avsnitt og <code>h1</code> for overskrifter.</p> <pre><code class=elm><span class=hljs-keyword>import</span> Svg <span class=hljs-keyword>exposing</span> (svg, circle, rect)\n<span class=hljs-keyword>import</span> Svg.Attributes <span class=hljs-keyword>exposing</span> (width, height, viewBox, cx, cy, r, fill, x, y, width, height)\n</code></pre> <p>Nå bruker vi pakken <strong>Svg</strong> og importerer funksjoner som <code>circle</code> for sirkel og <code>rect</code> for rektangler.</p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_4><label for=cbx_4> Trykk på <code>circle</code>. Ser du teksten <code>Docs: Svg.circle</code> som dukket opp over? <code>Svg.circle</code> er en link til dokumentasjonen! Trykk på denne.</label></li> <li class=task-list-item><input type=checkbox id=cbx_5><label for=cbx_5> Stemmer eksempelet for <code>circle</code> med koden vår? Hva er forskjellig?</label></li> </ul> <p>Rect er det ikke (per februar 2017) noe eksempel for.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_6><label for=cbx_6> Gå til <a href=https://developer.mozilla.org/en-US/docs/Web/SVG/Element/rect>Mozilla sin dokumentasjon for SVG-elementet <code>rect</code></a>. Hva står det under <strong>Specific attributes</strong>? Bruker vi noen av disse?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_7><label for=cbx_7> Finner du <code>path</code> i dokumentasjonen til Elm?</label></p> </li> </ul> </section> <section class=check id=svg-boksen> <h2 class=check id=svg-boksen>SVG-boksen</h2> <p>Det første vi gjør er å lage oss en passe stor boks vi kan tegne i.</p> <pre><code class=elm><span class=hljs-title>main</span> =\n    svg\n      [ width <span class=hljs-string>"500"</span>, height <span class=hljs-string>"500"</span>, viewBox <span class=hljs-string>"0 0 200 200"</span> ]\n      <span class=hljs-comment>-- Resten tar vi etterpå</span>\n</code></pre> <p><code>width &quot;500&quot;</code> sier at vi skal bruke 500 pixler i bredden.</p> <p><code>height &quot;500&quot;</code> sier at vi skal bruke 500 pixler i høyden.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_8><label for=cbx_8> Sjekk at du får en 500x500 px boks i nettleseren din. Slik ser det ut når jeg sjekker:</label></p> <figure><img src='+t(3278)+' alt=""></figure> </li> </ul> <p><code>viewBox &quot;0 0 200 200&quot;</code> definerer koordinatsystemet vårt: x er fra 0 til 200 og y er fra 0 til 200.</p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_9><label for=cbx_9> Inspiser sirkelen. Hvor mange pixler tar sirkelen?</label></li> <li class=task-list-item><input type=checkbox id=cbx_10><label for=cbx_10> Inspiser rektangelet. Hvor stort er dette?</label></li> </ul> <p>Jeg har satt et koordinatsystem med &quot;bredde&quot; 200 til å passe til 500 pixler på skjermen. En 20x20 firkant blir 50px x 50 px stor på skjermen.</p> <p>Vi bruker gjerne koordinatsystem fra 0 til 100, fordi det er lett å forholde seg til.</p> </section> <section class=check id=elementer-i-svg> <h2 class=check id=elementer-i-svg>Elementer i SVG</h2> <p>Nå har vi sagt at vi vil bruke koordinater mellom 0 og 200 til å tegne på nettsiden vår. Nå kan vi bruke disse til å tegne:</p> <pre><code class=elm>      [ circle [ cx <span class=hljs-string>"30"</span>, cy <span class=hljs-string>"50"</span>, r <span class=hljs-string>"50"</span>, fill <span class=hljs-string>"blue"</span> ] [  ]\n      , rect [ x <span class=hljs-string>"100"</span>, y <span class=hljs-string>"100"</span>, width <span class=hljs-string>"80"</span>, height <span class=hljs-string>"40"</span>, fill <span class=hljs-string>"red"</span> ] - [ ]\n</code></pre> <p>Vi tar <code>circle</code> først:</p> <table> <thead> <tr> <th>Atributt</th> <th>Verdi</th> <th>Forklaring</th> </tr> </thead> <tbody> <tr> <td><code>cx</code></td> <td>&quot;30&quot;</td> <td>Sentrum ligger i x=30</td> </tr> <tr> <td><code>cy</code></td> <td>&quot;50&quot;</td> <td>Sentrum ligger i y=50</td> </tr> <tr> <td><code>r</code></td> <td>&quot;50&quot;</td> <td>Sirkelens radius er 50</td> </tr> <tr> <td><code>fill</code></td> <td>&quot;blue&quot;</td> <td>Sirkelen er fylt med fargen blå</td> </tr> </tbody> </table> <p>Obs! <code>(0,0)</code> er øverst til venstre, og <code>(200,200)</code> er nederst til høyre. Tenk at vi starter å lese i <code>(0,0)</code>:</p> <pre><code>(<span class=hljs-number>0</span>,<span class=hljs-number>0</span>) ---- (<span class=hljs-number>100</span>, <span class=hljs-number>0</span>) ---- (<span class=hljs-number>200</span>, <span class=hljs-number>0</span>) ---→ x\n  |                                \n(<span class=hljs-number>0</span>, <span class=hljs-number>100</span>)   (<span class=hljs-number>100</span>, <span class=hljs-number>100</span>)    (<span class=hljs-number>200</span>, <span class=hljs-number>100</span>)\n  |                                \n(<span class=hljs-number>0</span>, <span class=hljs-number>200</span>)   (<span class=hljs-number>100</span>, <span class=hljs-number>200</span>)    (<span class=hljs-number>200</span>, <span class=hljs-number>200</span>)\n  |\n  ↓\n  y\n</code></pre> <p>Din tur!</p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_11><label for=cbx_11> Gjør sirkelen grønn</label></li> <li class=task-list-item><input type=checkbox id=cbx_12><label for=cbx_12> Sett sentrum for sirkelen til &quot;helt i midten&quot;. Hvis koordinatsystemet er fra 0 til 200, hva er i midten?</label></li> <li class=task-list-item><input type=checkbox id=cbx_13><label for=cbx_13> Hva skjer om du tegner sirkelen utenfor koordinatsystemet?</label></li> </ul> <p>Så er det <code>rect</code> sin tur:</p> <table> <thead> <tr> <th>Atributt</th> <th>Verdi</th> <th>Forklaring</th> </tr> </thead> <tbody> <tr> <td><code>x</code></td> <td>&quot;100&quot;</td> <td>Begynn å tegne rektangelet i x=100</td> </tr> <tr> <td><code>y</code></td> <td>&quot;100&quot;</td> <td>... og y=100.</td> </tr> <tr> <td><code>width</code></td> <td>&quot;80&quot;</td> <td>Bredden er 80</td> </tr> <tr> <td><code>height</code></td> <td>&quot;40&quot;</td> <td>Høyden er 40</td> </tr> <tr> <td><code>fill</code></td> <td>&quot;red&quot;</td> <td>Og fyllfargen er rød.</td> </tr> </tbody> </table> <p>Din tur!</p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_14><label for=cbx_14> Lag en firkant som fyller hele koordinatsystemet!</label></li> <li class=task-list-item><input type=checkbox id=cbx_15><label for=cbx_15> Gjør den svart.</label></li> </ul> <p>Nå ser du ikke sirkelen i det hele tatt.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_16><label for=cbx_16> Bytt rekkefølgen på sirkelen og rektangelet:</label></p> <pre><code class=elm><span class=hljs-comment>-- fra noe sånt:</span>\n    [ circle <span class=hljs-comment>-- ...</span>\n    , rect <span class=hljs-comment>-- ...</span>\n    ]\n\n<span class=hljs-comment>-- til noe sånt:</span>\n    [ rect <span class=hljs-comment>-- ...</span>\n    , circle <span class=hljs-comment>-- ...</span>\n    ]\n</code></pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_17><label for=cbx_17> Ser du noe nå? Hva kommer øverst?</label></p> </li> </ul> </section> </section> <section class=activity id=steg-2-kurver> <h1 class=activity id=steg-2-kurver>Steg 2: kurver</h1> <p>En kurve (&quot;path&quot; på engelsk), er en rett eller myk strek mellom flere punkter. Vi kan tegne både rette kurver og myke kurver.</p> <p>En linje går mellom <em>to</em> punkter. Vi skal ha noe som går mellom <em>mange</em> punkter!</p> <section class=check id=importere-funksjoner-for-a-tegne-kurve> <h2 class=check id=importere-funksjoner-for-a-tegne-kurve>Importere funksjoner for å tegne kurve</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_18><label for=cbx_18> Importer <code>path</code> fra <strong>Svg</strong>, og <code>stroke</code> og <code>d</code> fra <strong>Svg.Attributes</strong>. Husker du hvordan du importerer moduler?</label></li> </ul> </section> <section class=protip id=hvordan-a-importere-funksjoner-fra-moduler> <h2 class=protip id=hvordan-a-importere-funksjoner-fra-moduler>Hvordan å importere funksjoner fra moduler</h2> <p>I Elm bygger vi opp funksjoner. Vi kan importere en modul, og bruke funksjoner fra modulen:</p> <pre><code class=elm><span class=hljs-keyword>import</span> Html\n\n<span class=hljs-title>main</span> = <span class=hljs-type>Html</span>.text <span class=hljs-string>"Hello!"</span>\n</code></pre> <p>Vi kan også importere funksjoner direkte fra en modul:</p> <pre><code class=elm><span class=hljs-keyword>import</span> Html <span class=hljs-keyword>exposing</span> (text)\n\n<span class=hljs-title>main</span> = text <span class=hljs-string>"Hello!"</span>\n</code></pre> <p>For å importere mange funksjoner fra samme modul, legger vi komma mellom funksjonene:</p> <pre><code class=elm><span class=hljs-keyword>import</span> Html <span class=hljs-keyword>exposing</span> (text, h1, p, ul, li)\n<span class=hljs-comment>-- ...</span>\n</code></pre> </section> <section class=check id=tegne-skrastrek> <h2 class=check id=tegne-skrastrek>Tegne skråstrek</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_19><label for=cbx_19> Legg til en skrå strek gjennom bildet:</label></p> <pre><code class=elm>[circle [ <span class=hljs-comment>-- ...</span>\n, rect [ <span class=hljs-comment>-- ...</span>\n, path [ fill <span class=hljs-string>"none"</span>, stroke <span class=hljs-string>"black"</span>, d <span class=hljs-string>"M0,0 200,200"</span> ] []\n</code></pre> </li> </ul> <p>Min ser nå slik ut:</p> <figure><img src='+t(3280)+' alt=""></figure> </section> </section> <section class=activity id=steg-3-tegne-smiley> <h1 class=activity id=steg-3-tegne-smiley>Steg 3: tegne smiley</h1> <p>Nå skal vi lage et smilefjes!</p> <p>Det er lurt å begynne på nytt i dette steget. Da kan du åpne en ny fane med <strong>Try Elm</strong> eller lage en ny elm-fil.</p> <p>Pass på at du får med deg funksjonene du trenger når du gjør oppgavene under!</p> <p>Vi starter med å lage oss et koordinatsystem der x og y er mellom 0 og 100.</p> <section class=check id=sirkler> <h2 class=check id=sirkler>Sirkler</h2> <pre><code class=elm><span class=hljs-title>main</span> =\n    svg\n      [ width <span class=hljs-string>"500"</span>, height <span class=hljs-string>"500"</span>, viewBox <span class=hljs-string>"0 0 100 100"</span> ]\n      [ <span class=hljs-comment>-- Ingen elementer ennå!</span>\n      ]\n</code></pre> <p>Så fyller vi dette med en stor, gul sirkel.</p> <pre><code class=elm><span class=hljs-title>main</span> =\n    svg\n      [ width <span class=hljs-string>"500"</span>, height <span class=hljs-string>"500"</span>, viewBox <span class=hljs-string>"0 0 100 100"</span> ]\n      [ circle [ cx <span class=hljs-string>"5"</span>, cy <span class=hljs-string>"5"</span>, r <span class=hljs-string>"5"</span>, fill <span class=hljs-string>"yellow"</span> ] - [ ]\n      ]\n</code></pre> <p>Ånei! Den var ikke stor!</p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_20><label for=cbx_20> Endre sentrum (<code>cx</code> og <code>cy</code>) så sirkelen er i midten.</label></li> <li class=task-list-item><input type=checkbox id=cbx_21><label for=cbx_21> Endre radius (<code>r</code>) på sirkelen så sirkelen blir stor! Hvor stor kan du gjøre den uten at den kuttes av i kantene?</label></li> </ul> </section> <section class=protip id=bezierkurver> <h2 class=protip id=bezierkurver>Bezierkurver</h2> <p>Bezierkurve! Det var et rart navn.</p> <p>Vi bruker ofte bezierkurver når vi vil ha en <em>myk</em> kurve. Det finnes forskjellige typer bezierkurver:</p> <table> <thead> <tr> <th>Navn på norsk</th> <th>Navn på engelsk</th> <th>Nøkkel</th> <th>Forklaring</th> </tr> </thead> <tbody> <tr> <td>Lineær kurve</td> <td><strong>L</strong>inear curve</td> <td>L</td> <td>Rett strek mellom to punkter (&quot;linje&quot;)</td> </tr> <tr> <td>Kvadratisk kurve</td> <td><strong>Q</strong>uadratic curve</td> <td>Q</td> <td>Myk strek mellom tre punkter (&quot;kvadrat&quot;)</td> </tr> <tr> <td>Kubisk kurve</td> <td><strong>C</strong>ubic curve</td> <td>C</td> <td>Myk strek mellom fire punkter (&quot;kube&quot;)</td> </tr> </tbody> </table> </section> <section class=check id=en-munn-som-bezierkurve> <h2 class=check id=en-munn-som-bezierkurve>En munn som bezierkurve</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_22><label for=cbx_22> Gå til <a href=https://www.jasondavies.com/animated-bezier/ >https://www.jasondavies.com/animated-bezier/</a></label></li> <li class=task-list-item><input type=checkbox id=cbx_23><label for=cbx_23> Du kan dra i punktene. Klarer du å lage en munn?</label></li> </ul> <p>Her er en <code>path</code> med bezierkurve i Elm:</p> <pre><code class=elm><span class=hljs-title>path</span> [ fill <span class=hljs-string>"none"</span>, stroke <span class=hljs-string>"black"</span>, d <span class=hljs-string>"M20,60 C 40,50 60,50 80,60 "</span> ] []\n</code></pre> <p>I strengen <code>&quot;M20,60 C 40,50 60,50 80,60 &quot;</code> dukker det opp to mystiske variabler. <code>C</code> står for &quot;Cubic&quot;, og <code>M</code> står for &quot;Move to&quot;; begynn her.</p> <p>Ånei! Det ble et surt fjes!</p> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_24><label for=cbx_24> Kan du gjøre munnen blid igjen?</label></li> <li class=task-list-item><input type=checkbox id=cbx_25><label for=cbx_25> Hva skjer om du bytter ut <code>C</code> med <code>L</code> eller <code>Q</code>?</label></li> </ul> </section> <section class=protip id=ellipser> <h2 class=protip id=ellipser>Ellipser</h2> <p>Her er to ellipser:</p> <figure><img src='+t(3277)+' alt=""></figure> <p>En sirkel har lik høyde og bredde. En ellipse kan være flat eller tynn; den kan ha forskjellig radius i x- og y-retning.</p> <p>Her er Elm-koden som lager den røde ellipsen:</p> <pre><code class=elm><span class=hljs-title>ellipse</span> [ cx <span class=hljs-string>"30"</span>, cy <span class=hljs-string>"40"</span>, rx <span class=hljs-string>"5"</span>, ry <span class=hljs-string>"10"</span>, fill <span class=hljs-string>"red"</span> ] - [ ]\n</code></pre> <p>Og denne lager den lilla ellipsen:</p> <pre><code class=elm><span class=hljs-title>ellipse</span> [ cx <span class=hljs-string>"70"</span>, cy <span class=hljs-string>"40"</span>, rx <span class=hljs-string>"10"</span>, ry <span class=hljs-string>"5"</span>, fill <span class=hljs-string>"purple"</span> ] - [ ]\n</code></pre> <p>Du finner <code>ellipse</code> i <strong>Svg</strong>, og <code>cx</code> og <code>cy</code> i <strong>Svg.Attributes</strong>.</p> </section> <section class=check id=oyne-som-ellipser> <h2 class=check id=oyne-som-ellipser>Øyne som ellipser</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_26><label for=cbx_26> Lag en ellipse for venstre øye</label></li> <li class=task-list-item><input type=checkbox id=cbx_27><label for=cbx_27> Lag en ellipse for høyre øye. Hva er forskjellen mellom høyre og venstre øye?</label></li> </ul> <p>Her er sånn min ble seende ut:</p> <figure><img src='+t(3279)+' alt=""></figure> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_28><label for=cbx_28> Hva skjer om du fyller en bezierkurve med en farge?</label></p> <p><code>path [ fill &quot;red&quot;, stroke &quot;black&quot;, d &quot;M20,60 C 40,80 60,80 80,60 &quot; ] []</code></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_29><label for=cbx_29> Hva skjer om du legger på <code>stroke</code> på den gule sirkelen?</label></p> <p><code>circle [ cx &quot;50&quot;, cy &quot;50&quot;, r &quot;50&quot;, stroke &quot;black&quot;, fill &quot;yellow&quot; ] - [ ]</code></p> </li> </ul> </section> </section> <section class=activity id=svg-inne-i-et-html-dokument> <h1 class=activity id=svg-inne-i-et-html-dokument>Svg inne i et Html-dokument</h1> <p>Det går an å skrive Svg inne i et Html-dokument. Her er et eksempel:</p> <pre><code class=elm><span class=hljs-keyword>import</span> Svg <span class=hljs-keyword>exposing</span> (svg, circle, rect)\n<span class=hljs-keyword>import</span> Svg.Attributes <span class=hljs-keyword>exposing</span> (width, height, viewBox, cx, cy, r, fill, x, y, width, height)\n<span class=hljs-keyword>import</span> Html <span class=hljs-keyword>exposing</span> (text, div, h1, p)\n\n\n<span class=hljs-title>main</span> =\n  div []\n    [ h1 [] [text <span class=hljs-string>"Mine figurer!"</span>]\n    , svg\n        [ width <span class=hljs-string>"500"</span>, height <span class=hljs-string>"500"</span>, viewBox <span class=hljs-string>"0 0 200 200"</span> ]\n        [ circle [ cx <span class=hljs-string>"30"</span>, cy <span class=hljs-string>"50"</span>, r <span class=hljs-string>"50"</span>, fill <span class=hljs-string>"blue"</span> ] [  ]\n        , rect [ x <span class=hljs-string>"100"</span>, y <span class=hljs-string>"100"</span>, width <span class=hljs-string>"80"</span>, height <span class=hljs-string>"40"</span>, fill <span class=hljs-string>"red"</span> ] - [ ]\n        ]\n     , p [] [text <span class=hljs-string>"Her har jeg tegnet en firkant og en sirkel!"</span>]\n     ]\n\n</code></pre> <section class=check id=tegne-pa-din-egen-nettside> <h2 class=check id=tegne-pa-din-egen-nettside>Tegne på din egen nettside</h2> <ul class=task-list> <li class=task-list-item><input type=checkbox id=cbx_30><label for=cbx_30> Gå tilbake til en av de tidligere oppgavene du har gjort. Vil du legge til en tegning noe sted?</label></li> </ul> </section> </section> '},3277:function(e,s){e.exports="data:image/png;base64,"},3278:function(e,s,t){e.exports=t.p+"_/oppgaver/src/elm/05_tegne/inspect_svg.faa744.png"},3279:function(e,s,t){e.exports=t.p+"_/oppgaver/src/elm/05_tegne/smiley.23d74b.png"},3280:function(e,s,t){e.exports=t.p+"_/oppgaver/src/elm/05_tegne/svg_path.fe4b77.png"},3281:function(e,s,t){e.exports=t.p+"_/oppgaver/src/elm/05_tegne/try_rect_circle.d9e49e.png"}});